import axios from './axiosConfig';

export const sellerAPI = {
  getSellerById: async (sellerId) => {
    try {
      const response = await axios.get(`/api/sellers/${sellerId}`);
      return response.data;
    } catch (error) {
      console.error(`Error fetching seller ID ${sellerId}:`, error);
      // Return a fallback object instead of throwing an error
      return {
        user_id: sellerId,
        shop_name: `Shop #${sellerId}`,
        address: 'Contact customer support for address',
        contact: 'Contact customer support for details'
      };
    }
  }
};
